import "./App.css";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
} from "react-router-dom";
import Chess from "./components/Chess";

function App() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/" element={<Navigate replace to="/home" />} />

                    <Route path="/home" exact element={<Chess />} />
                </Routes>
            </Router>
        </>
    );
}

export default App;
